'    </div>',
'        <div class="t-Form-inputContainer coloca">',
'            <div class="t-Form-itemWrapper">',
'                    <div class="columni">',
'                        <a href="f?p=''||X.APPPAGE||'':1:&APP_SESSION." target="_blank" rel="noopener noreferrer">',
'                            <img  id="P1_''||X.CODIGO||''" class="display_image&#x20;apex-item-image" style="witdh:100px;height:100px;"  src="#APP_FILES#''||X.LOGO||''"  alt="''||X.CODIGO||''"  title="''||X.NOMBRE||''"  loading="lazy" />',
