'                    </div>',
'                    <span>&nbsp;</span>',
'                <span id="P1_''||X.CODIGO||''_error_placeholder" class="a-Form-error" data-template-id="28623761254564999_ET"></span>',
'            </div><span class="nmod">''||X.CODIGO||''</span>',
'        </div>',
'  </div>'');',
'END LOOP;',
'HTP.P(''</div>'');',
'END;'))
,p_plug_source_type=>'NATIVE_PLSQL'
);
